(46, 'Размеры', 'Форм-фактор материнской платы', 'Форм-фактор определяет размеры, точки крепления, расположение и количество разъемов материнской платы. ATX – стандартный формат (305x244 мм) для стационарных ПК (корпусов ATX) с максимальным количеством слотов. MicroATX – компактный формат (244x244 мм) с меньшим количеством слотов, подходящий для полноразмерных (ATX) и уменьшенных (mATX) корпусов. Сверхкомпактные материнские платы Mini-ITX (170x170 мм) предназначены для сборки маленьких ПК. Имеют поддержку современных многоядерных процессоров.'),
