(8, 'Система водяного охлаждения ЮКОМС', 'sistema-vodyanogo-ohlazhdeniya', 6200, 7, 7, 4256, 99, '2025-01-30 15:10:52.231586', '<p><strong>Система водяного охлаждения ЮКОМС</strong> &mdash; это высокоэффективное решение для обеспечения оптимальной температуры в различных технологических процессах. Разработанная с учетом последних достижений в области теплоотведения, система гарантирует стабильную работу оборудования даже при высоких нагрузках. Водяное охлаждение ЮКОМС отличается низким уровнем шума, высокой надежностью и долговечностью, что делает её идеальным выбором для промышленных объектов, серверных помещений и других сфер, где важна высокая теплоотдача и безопасность.</p>'),
(9, 'Intel Core i5 11400', 'intel-core-i5-11400', 20000, 1, 1, 12249, 99, '2025-02-10 15:58:25.524010', '<p><strong>Процессор Intel Core i5-11400</strong> - это мощное вычислительное устройство, способное обеспечить высокую производительность и отличное качество работы в различных задачах. Этот процессор из линейки Core i5 имеет модель 11400 и представляет собой отличное сочетание цены и качества.</p>\r\n\r\n<p><br />\r\nСердцем процессора является архитектура <u>Cypress Cove</u> и ядро <u>Rocket Lake-S</u>, которые обеспечивают высокую производительность и эффективность работы. С 6 ядрами и 12 потоками этот процессор способен обрабатывать сложные задачи с легкостью, что делает его отличным выбором для геймеров, видеомонтажеров и других профессионалов.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Частота шины DMI 3.0 составляет 8 ГТ/с, что обеспечивает быструю передачу данных и минимизирует задержки при выполнении задач. Объем кэша L1 составляет 64 Кб, L2 - 1 Мб, а L3 - 12 Мб, что позволяет процессору быстро обращаться к данным и повышает его производительность.<br />\r\n<br />\r\nТехнологический процесс 14 нм обеспечивает энергоэффективность и надежность работы процессора, что позволяет ему работать стабильно и эффективно даже при высоких нагрузках. Socket LGA 1200 обеспечивает простой и надежный монтаж процессора на материнскую плату, что делает его удобным в использовании.</p>'),
(10, 'AMD Ryzen 5 5600X', 'amd-ryzen-5-5600x', 22000, 2, 1, NULL, 99, '2025-02-10 15:58:25.643802', ''),
(11, 'Intel Core i7 12700K', 'intel-core-i7-12700k', 35000, 1, 1, 25900, 99, '2025-02-10 15:58:25.721121', '<p><img alt=\"\" src=\"https://ir.ozone.ru/s3/multimedia-1-z/ww1200/7247872151.jpg\" style=\"float:left; height:150px; width:148px\" /><strong>Intel Core i7-12700K</strong> представляет собой процессор 12-го поколения, построенный на основе архитектуры Alder Lake-S. Он имеет 12 ядер (8 производительных и 4 энергоэффективных), которые работают на частоте от 3,6 до 5 ГГц в турбо-режиме. TDP процессора составляет 125 Вт в базовом режиме и 190 Вт в турбо-режиме, что обеспечивает высокую производительность при низком энергопотреблении.</p>\r\n\r\n<p><strong>Комплектация</strong>: Процессор</p>\r\n\r\n<p><strong>Гарантийный срок</strong>: 1 год</p>'),
(12, 'AMD Ryzen 7 5800X', 'amd-ryzen-7-5800x', 30000, 2, 1, 21999, 99, '2025-02-10 15:58:25.782794', '<p><strong>Процессор AMD Ryzen 7 5800X 3.8 ГГц OEM</strong>&nbsp;представляет собой мощное вычислительное ядро для эффективной работы как в играх, так и при выполнении тяжелых многозадачных задач. С 8 ядрами и 16 потоками, работающими на базовой частоте 3.8 ГГц, этот процессор обеспечивает быстродействие на высоком уровне.</p>\r\n\r\n<p>С благодаря архитектуре Zen 3, процессор предоставляет улучшенную производительность по сравнению с предыдущими поколениями. Технология Precision Boost 2 автоматически регулирует тактовую частоту, обеспечивая оптимальное соотношение между производительностью и энергопотреблением.</p>\r\n\r\n<p>Процессор снабжен кэш-памятью L3 в размере 32 МБ, что способствует более эффективной обработке данных. Благодаря поддержке PCIe 4.0, вы можете наслаждаться высокоскоростным доступом к современным NVMe SSD и графическим картам.</p>\r\n\r\n<p><strong>AMD Ryzen 7 5800X</strong> - отличное решение для геймеров, креативных профессионалов и тех, кто ценит высокую производительность и многозадачность в своей системе.</p>'),
(13, 'AMD Radeon RX 7900 XTX', 'amd-radeon-rx-7900-xtx', 111112, 2, 2, 109240, 99, '2025-02-10 15:58:25.844278', '<p><img alt=\"\" src=\"http://ir.ozone.ru/s3/multimedia-r/ww1200/6546220431.jpg\" style=\"float:left; height:300px; width:300px\" /></p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h4>&nbsp; Новый, оригинальный товар от официальных дистрибьюторов брендов</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>');
